import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import CardItem from '.././CardItem';

export default function Flipic() {
  return (
    <>
    <h1 className='Flipic'>Flipic</h1>

    {/* Custom Cards*/}
    <div className='cards'>
      <h1>Flipic is a fun approach to collecting data for data-driven decision-making</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src='images/img-3.jpg'
              text='Github Repository'
              label='Codebase'
              onclick = "location.href='google.com';"
              path = '/google'
            />
            <CardItem
              src='images/img-4.jpg'
              text='Like Tinder for Making Tricky Choices!'
              label='Flipic'
              path='/Flipic'
            />
            <CardItem
              src='images/img-8.jpg'
              text='Compassion Training Support Application'
              label='Doctra'
              path='/Doctra'
            />
          </ul>
        </div>
      </div>
    </div>

    {/* <p1> Flipic is cool</p1> */}
    <Cards />
    {/* <HeroSection /> */}
    <Footer />
  </>
  );
}
